                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'It was once the Byron Bay clubhouse for the bowling green over the road, but when Kimberly and Stephen, stumbled on it in 2005 it was a “feral” backpackers’ hostel with three gloomy rooms upstairs. “And underneath was a damp storage area that was often flooded and home to water dragons,” Kimberly says. \n\nThe couple tossed around ideas about how to transform it, then over six months, made them a reality. “We lifted and gutted the three bedrooms upstairs and rebuilt the entire downstairs,” Kimberly says. It’s now an airy four-bedroom family home with ensuites and private decks.\n\nFor those who are in love with the style of the home, you can experience it for yourself. The house is part of a property that includes Kimberly and Stephen’s boutique hotel [The Atlantic Byron Bay](http://atlanticbyronbay.com.au/|target="_blank").\n\nThe home and hotel emanate a laidback holiday vibe inspired by Hawaii, the Bahamas, the Hamptons and, of course, Byron Bay. A Mini Moke beach buggy, a sentimental purchase, parked in the carport ups the holiday feel. “It reminds me of my childhood in Noosa,” Kimberly says. “I’d always wanted one as the family ‘surf car’ so when my dad rang to say a friend was selling one of his, I jumped at it.”'
