                                'Set on the banks of the Lachlan River in central NSW, Droubalgie, the family estate of industrial designer [Charles Wilson](http://www.charleswilsondesign.com.au/|target="_blank") is decorated in a classic country-style with an occasional piece of his contemporary furniture thrown in to create an offbeat yet charming home. “The farm is the perfect respite from city life, a place to relax and concentrate on new designs,” says Charles.\n\nArticle from: *Australian House and Garden*\nText: Stephen Todd\nPhotos: Maree Homer\nStyling: Kate Nixon'
