                                'Homeowners Patrick and Alex Nicholas are big into surfing. So when Patrick, an architect at [AN+A](http://www.anplusa.com/|target="_blank"), saw a 1970s house on a battle-axe block in North Bondi, he didn’t hesitate to snap it up for the couple and their three kids. \n\n“Originally, the lower level had never been excavated,” he explains. “We decided to scoop out the undercroft and relocate the living spaces to the ground floor to give them garden access and then use the unearthed sandstone to level the garden for a real indoor-outdoor connection.”'
