                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'The renovation begins'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'The alterations and additions that Patrick designed for the former three-bedroom, two-bathroom house occurred in two stages. The major structural work was carried out in 2006 with the completion of the interior fit-out plus the addition of an outdoor room finished in 2012. \n\n“We kept elements of the old house; we liked the fact there was a big carport alongside a courtyard garden at the entrance. But, as it was open to the sky, we covered it with hardwood battens topped with fibreglass roofing for weather protection.”  \n\nThe previous kitchen was transformed into a welcoming entrance foyer with a new staircase tucked to one side. Above, a sky-lit double space void filters morning light deep into the newly-constructed downstairs kitchen/dining/living rooms.'
                        },
                        {
                            type: 'quote',
                            label: 'Quote',
                            content: 'The former living room has become the kids’ playroom. We didn’t have the heart to carve it up.'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Upstairs, the main bedroom was rebuilt into a former balcony and an ensuite created. The children’s bedrooms were retained, including the original windows. “The former living room has become the kids’ playroom. We didn’t have the heart to carve it up,” Patrick says.'
                        },
                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Mid-century modern'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'The abode’s 1972 birth-date combined with the couple’s admiration for Californian mid-century architecture informed the shading solution for the west-facing rear exterior. A white screen with adjustable aluminium blades protecting the full façade is a visor-like piece de resistance. In contrast, the laid-back, new outdoor room built from spotted gum softens the home’s glass and steel-frame geometric lines. \n\nThroughout all the interiors, curated collections of flotsam and jetsam happily co-exist alongside pieces such as wall-mounted Andy Warhol skateboard decks, inherited vintage maps, ceramics, sculptures, indigenous artefacts and street art. Adding tactile interest is a palette of natural materials such as the cross-cut travertine that features around the fireplace.\n\nWhile it may be non-conformist, this home with its easy-breezy coastal vibe perfectly captures the family’s heartbeat. “We’ve filled it with items that we love and we use – such as the surfboards and skateboards – and there’s enough space to have these out on display,” Patrick says.'
                        }
