                                            caption:
                                                '“The sloping roof is an important design feature,” architect Adrian Amore says. “The space feels lofty, and roomier than what it actually is, with the highlight window above the doors drawing valuable light," says friend and architect [Adrian Amore](http://www.aaarchitects.com.au/|target="_blank").\n\n\n**Outdoor table** from [Tait](http://madebytait.com.au/|target="_blank").',
