                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'It seems logical that fashion and the world of interior design are intertwined. After all, design is design, right? Merely a concept waiting to be put into practice. So it’s only fitting that the home of Jamie Blakey – fashion designer and owner of Australian clothing label [One Teaspoon](http://www.oneteaspoon.com.au/|target="_blank")  – flaunts her signature relaxed-rock-‘n’-roll style. \n\nNestled behind the sand dunes of a beach just north of Sydney’s CBD, Jamie’s chic beach shack, which she shares with her husband Ron and their three kids, oozes with charisma. \n\nVintage band posters rest against creamy interior walls, alongside delicate hunks of coral and carefully considered homewares – designed by Jamie, of course. The skate ramp in the back garden, along with racks of surfboards on the deck, add bonus street cred to an already authentic home.'
