                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'From barn to beautiful'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Surprisingly, this wasn’t always the case. Jamie says that when they bought the house it was a charming shade of “avocado”. Also, sticking to the retro theme, all the timber inside was oiled, polished and a little bit on the orange side. “It had a ‘barn by the beach’ feel,” Jamie adds, “so we loved it for that. But we just needed to put our stamp on it.”'
                        },
                        {
                            type: 'quote',
                            label: 'Quote',
                            content: '“It’s a work in progress,” Jamie says. “But I guess all houses are.”'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'And stamp they did. Along with a slight adjustment to the floorplan, the couple removed all of the orangey timber, installed a new kitchen and whitewashed the floorboards. The entire interior was painted crisp white, in keeping with the beachy setting, and the exterior a chic charcoal.'
                        },
                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'A fashionable palette'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Jamie admits the design philosophy behind her label One Teaspoon was put into practice when it came to renovating and decorating the home, and it’s clear that she leans towards the same colour palette for both fashion and homewares: black, white and denim. Plus, recurring themes of linen, timber, bone, glass and hide subtly link each room together, creating an overall look that is restrained yet totally unique. \n\nJamie and Ron spend a fair bit of time at their pad by the sea – Ron works from home in a “shed” in the back garden, and the back deck proves a sunny spot for Jamie to design new ranges for her label. They often have friends popping by on their way down to the beach for a surf, so when they’re home their friends tend to stay. \n\nAfter all, with a house this cool, who would want to leave?'
                        }
