                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Renovation or demolition?'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'The couple lived in the front portion of the house for a year with sons Alex and Tommy (since joined by little sister Evie) while the project was underway. “The boys didn’t quite understand why their backyard was a gravel heap and the kitchen was even more basic than the previous one,” says Martin, who continued to think, at times, that it would have been easier to knock the house down. The fact that the building had literally sunk by 10cm made the case for demolition even stronger.'
                        },
                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Period details'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Meanwhile, Paula was already scouring secondhand yards for leadlight windows and doors appropriate to the period. “As the house was built in 1910, I was looking for leadlight that wasn’t overly decorative and normally associated with the Victorian period,” she says. Missing fireplaces were also reinstated.'
                        },
                        {
                            type: 'tips',
                            label: 'Tips',
                            content:
                                "## Owner's Tip\n“To avoid last-minute design changes, make sure the items you’ve selected are available, and that your builder allows for product lead-times,” says Paula."
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'But these decorative additions formed only a small part of the renovation, which included a major reworking of the existing house and a substantial two-storey extension to the rear. The couple removed a lean-to and added an open-plan kitchen, dining and living area, together with a main bedroom, ensuite and living area/library upstairs.'
                        },
                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Contemporary extension and a kitchen makeover'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'In contrast to the original rooms, with their restored decorative embellishments, the extension is minimal and contemporary. Large sliding doors link the interior spaces to the courtyard and back garden. In the new wing, polished concrete flooring takes over from the timber floors in the front rooms. \n\nThe kitchen functions as the hub of the house, with a central island bench that extends to form a breakfast bar. To minimise clutter, there’s also a butler’s pantry, accommodating Martin’s long-coveted coffee machine. With their time fully occupied by young children and running a design practice, the couple selected finishes that were robust and low-maintenance, such as vinyl-wrap joinery.'
                        },
                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Renovating rewards'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'One of the great rewards in renovating this house has been the re-emergence of favourite pieces of furniture and objects from storage. “In our previous home, we simply didn’t know where to put things,” says Paula. “Even just removing a soap dish from an old shoebox and placing it in our new ensuite was lovely.”\n\nThe renovation is designed for the long haul. Adding the second level “will allow us to stay here for years”, says Martin. “The house will be used differently in a few years when the children grow up,” says Paula. “But for now, it’s about being able to keep an eye on them and enjoying the ‘transparency’ of the house.”'
                        },
                        {
                            type: 'competition',
                            label: 'Competition',
                            content: 'https://display.engagesciences.com/embed/5ea47964-3c4b-4b54-9155-ab753683ddc5'
                        }
